<script type="text/javascript">
	function parseXML(xml){
		var xmlDoc=null;
		if(window.DOMParser){
			var parser=new DOMParser();
			xmlDoc=parser.parseFromString(xml,"application/xml");
			
		}else{
			xmlDoc=new ActiveXObject("Microsoft.XMLDOM");
			xmlDoc.async=false;
			xmlDoc.loadXML(xml);
		}
		return xmlDoc;
	}
</script>
